window.bookSummaryJSON = "<p>It's an age-old question with a straightforward answer: Who wants to be a millionaire? Well, everyone does, of course! The tough part is figuring out how. And believe it or not, if you're a dealer or manager in the automotive industry, you might be missing out on one of the biggest ways to increase your earning potential. The best part? You already have all of the tools and resources you need at your disposal. </p> <p>As a 20-year veteran marketer renowned for growing businesses of all types, Jim Flint knows firsthand the difference a dealer's digital presence can bring to real-life sales. And in <i>Car Dog Millionaire</i>, he shares the valuable research he's conducted over the years - combined with Google's own astonishing data on how website visits correlate to car sales. </p> <p>Using an entertaining quiz show format, this guide will let you know the truth about the power of online marketing and how this information can be used to your advantage. In addition to real-life research, trivia, and valuable advice, you'll be able to hear candid conversations with car dealers as they put these methods to work for themselves and address the most successful strategies for improving their sales. </p>"; 
